import './App.css';
import React, {useState, useEffect} from "react";
import Axios from 'axios';

function App() {
  const [illnessName, setillnessName] = useState('');
  const [illnessInfo, setillnessInfo] = useState('');
  const [findIll, setfindIll] = useState('');
  const [illnessWishList, setillnessWishList] = useState([]);
  const [UserFirstName,setUserFirstName] = useState('');
  const [UserLastName,setUserLastName] = useState('');
  const [UserPassword, setUserPassword]= useState(''); 
  const [UserCountry, setUserCountry] = useState('');
  const [UserGender, setUserGender] = useState('');
  const [UserAge, setUserAge] = useState('');

  useEffect(() => {
    Axios.get('http://localhost:3002/api/get').then((response) => {
      setillnessWishList(response.data)
    })
  },[])

  const submitCreateUser = () => { 
    Axios.post('http://localhost:3002/api/insertUser', {
      UserFirstName: UserFirstName,
      UserLastName: UserLastName,
      UserPassword: UserPassword,
      UserCountry: UserCountry,
      UserGender: UserGender,
      UserAge: UserAge
    });
  };

  const submitWish = () => { 
    Axios.post('http://localhost:3002/api/insert', {
      illness_name: illnessName,
      illness_description: illnessInfo
    });

    setillnessWishList([
      ...illnessWishList,
      {
        illness_name: illnessName,
        illness_description: illnessInfo
      },
    ]);
  };
  const submitSearch = (illnessName) => {
    Axios.search(`http://localhost:3002/api/search/${findIll}`);
  };

  // const deleteReview = (illnessName) => {
  //   Axios.delete(`http://localhost:3002/api/delete/${illnessName}`);
  // };

  // const updateReview = (illnessName) => {
  //   Axios.put(`http://localhost:3002/api/update`, {
  //     illnessName: illnessName,
  //     movieReview: newReview
  //   });
  //   setNewReview("")
  // };


  return (

    <div className="App">
      <h1> User Sign Up</h1>
      <div className="form">
        <label style={{display: 'inline-block'}}> First Name:</label>
        <input type="text" name="UserFirstName" style={{display: 'inline-block'}} onChange={(e) => {
            setUserFirstName(e.target.value)
        } }/>
        <label style={{display: 'inline-block'}}> Last Name:</label>
        <input style={{display: 'inline-block'}} type="text" name="UserLastName" style={{display: 'inline-block'}} onChange={(e) => {
            setUserLastName(e.target.value)
        }}/>
        <label style={{display: 'inline-block'}}> Password:</label>
        <input type="text" name="UserPassword" style={{display: 'inline-block'}} onChange={(e) => {
            setUserPassword(e.target.value)
        }}/>
        <label style={{display: 'inline-block'}}> Country:</label>
        <input type="text" name="UserCountry" style={{display: 'inline-block'}} onChange={(e) => {
            setUserCountry(e.target.value)
        }}/>
        <label style={{display: 'inline-block'}}> Gender:</label>
        <input type="text" name="UserGender" style={{display: 'inline-block'}} onChange={(e) => {
            setUserGender(e.target.value)
        }}/>
        <label style={{display: 'inline-block'}}> Age:</label>
        <input type="text" name="UserAge" style={{display: 'inline-block'}} onChange={(e) => {
            setUserAge(e.target.value)
        }}/>
        <button onClick={submitCreateUser}> Submit</button>
      </div>


      <h1> INSERT WHISHLIST</h1>

      <div className="form">
        <label> Wishlist for new illness information:</label>
        <input type="text" name="illnessName" onChange={(e) => {
          setillnessName(e.target.value)
        } }/>
        <label> Illness information:</label>
        <input type="text" name="illnessInfo" onChange={(e) => {
          setillnessInfo(e.target.value)
        }}/>

        <button onClick={submitWish}> Submit</button>


        <h1> SEARCH</h1>

        <div className="form">
          <label> Search for a existing Illiness:</label>
          <input type="text" name="findIll" onChange={(e) => {
            setfindIll(e.target.value)
          } }/>

          <button onClick={submitSearch}> Submit</button>

        {/* {illnessWishList.map((val) => {
          return (
            <div className = "card">
              <h1> illness name: {val.illnessName} </h1>
              <p>illness description: {val.illnessInfo}</p>
              <button onClick={() => { deleteReview(val.illnessName) }}> Delete</button>
              <input type="text" id="updateInput" onChange={(e) => {
                setNewReview(e.target.value)
              } }/>
              <button onClick={() => {
                updateReview(val.illnessName)
              }}> Update</button>
              </div>
          );

          ;
        })} */}

        </div>
      </div>

    </div>
  );
}

export default App;
